for (def factor : doc['enrichment.risk_factors']) {

    // --- 0. FILTRO DE POSITIVOS (Saltar inmediatamente) ---
    // Si el factor es positivo, usamos 'continue' para pasar al siguiente sin emitir nada.
    if (factor.contains("Trusted Seller") || factor.contains("TOP SELLER")) {
        continue;
    }

    // --- 1. FACTORES DE PRECIO ---
    if (factor.contains("Price is <40%")) {
        emit("Critical Price Drop (<40% val.)");

    } else if (factor.contains("Statistically Cheap")) {
        emit("Statistically Cheap (Z-Score)");

    } else if (factor.contains("EXTREME Price Anomaly")) {
        emit("EXTREME Price Anomaly");

    // --- 2. FACTORES DE CALIDAD Y COMPORTAMIENTO ---
    } else if (factor.contains("External Contact")) {
        emit("External Contact Attempt");

    } else if (factor.contains("Very Short Description")) {
        emit("Low Quality Desc.");

    } else if (factor.contains("Low Image Count")) {
        emit("Missing Photos (0-1)");

    } else if (factor.contains("Aggressive Title")) {
        emit("Aggressive Title (CAPS)");

    } else if (factor.contains("Risky Payment")) {
        emit("Risky Payment Method");

    } else if (factor.contains("User registered") || factor.contains("New User")) {
        emit("New User (<48h)");

    // --- 3. REPUTACIÃ“N DEL USUARIO (Solo Negativa) ---
    } else if (factor.contains("User has Scam Reports")) {
        emit("User Reported as Scam");

    } else if (factor.contains("No Reviews") || factor.contains("Dormant Account")) {
        emit("No Reputation / Dormant");

    // --- 4. KEYWORDS (Limpieza) ---
    } else if (factor.contains("Suspicious keywords") || factor.contains("Keyword found")) {
        String content = factor;
        int start = factor.indexOf("["); 
        int end = factor.lastIndexOf("]");

        if (start != -1 && end != -1) {
            content = factor.substring(start + 1, end);
        } else if (factor.contains(":")) {
            content = factor.substring(factor.indexOf(":") + 1);
        }

        content = content.replace("'", "").replace("\"", "");
        // Usamos regex simple para dividir
        def raw_keywords = /,/.split(content);

        for (def raw_kw : raw_keywords) {
            def clean_kw = raw_kw.trim();
            if (clean_kw.length() > 0) {
                emit('"' + clean_kw + '"'); 
            }
        }

    } else {
        // --- 5. FALLBACK ---
        // Emitimos cualquier otro factor no filtrado arriba
        emit(factor);
    }
}"}}}
